import React, { Component } from 'react';
import '../../statics/style/banner.css'

class Banner extends Component{
    constructor(props) {
        super(props);

    }

    render(){
        return(
            <div className="banner">
                <div>
                    {
                        this.props.bannerList.map((item)=>{
                            return (
                                <div key={item}>
                                    <img src={item} />
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        )
    }
}

export default Banner;
